#include <algorithm>
#include <iostream>
#include <vector>

using namespace std;

class Solution {
   public:
    bool lemonadeChange(vector<int>& bills) {
        int five = 0, ten = 0;

        auto it = bills.begin();
        while (it != bills.end()) {
            switch (*it) {
                case 5:  // No change required
                    five++;
                    break;
                case 10:
                    if (five == 0) {  // Not possible to give change
                        return false;
                    } else {  // Change with (1)five
                        five--;
                        ten++;
                    }
                    break;
                case 20:
                    if (ten < 1) {
                        if (five < 3) {  // Not possible to give change
                            return false;
                        } else {  // Change with (3)fives
                            five -= 3;
                        }
                    } else {
                        if (five < 1) {  // Not possible to give change
                            return false;
                        } else {  // Change with (1)ten & (1)five
                            ten--;
                            five--;
                        }
                    }
                    break;
            }
            it++;
        }
        return true;
    }
};

